Storyline: Supernatural horror about a group of college students who start receiving phone calls from the future, with each hearing themselves being murdered. One by one, a group of student friends begin receiving voice-mail messages from the future, that appear to feature the sounds of their last moments alive. With the tapes foretelling the time, date and manner of their demise, the chilling prophesies begin to come true, throwing those still alive into a state of blind panic. When she receives her own phone call, fellow student Beth Raymond (Shannyn Sossamon) faces a race against time to solve the deadly mystery.


